import ContentCss from "./content.module.css";

function Content(props) {
  return (
    <>
      <div className={ContentCss.container2}>
      <div className = {ContentCss.big_box}>

      </div>
          <img src={props.imageSrc} alt="An image" />
          <p>{props.string1}</p>
          <p>{props.string2}</p>
       
      </div>
    </>
  );
}

export default Content;
